import React, { Component } from "react";
import {
  Text,
  View,
  Button,
  Alert,
  FlatList,
  StyleSheet,
  TouchableOpacity
} from "react-native";
import EpsonEposSDK from "./EpsonEposSDK";

type Props = {};
export default class App extends Component<Props> {
  state = {
    printerStatus: "Disconnected",
    printerType: "",
    printerTarget: "",
    discoveredPrinters: []
  };

  componentDidMount() {
    EpsonEposSDK.emitter.addListener("PrinterStatusEvent", status => {
      this.setState(() => ({ printerStatus: status.printerStatus }));
    });
    EpsonEposSDK.emitter.addListener("PrinterResponseEvent", response => {
      Alert.alert("Response", " " + response.PrinterResponse, {
        cancelable: false
      });
    });
    EpsonEposSDK.emitter.addListener("PrinterDiscoveryEvent", response => {
      this.setState({
        discoveredPrinters: this.state.discoveredPrinters.concat({
          key: response.PrinterTarget,
          ip: response.PrinterIP,
          name: response.PrinterName,
          type: response.PrinterType
        })
      });
    });
  }

  componentWillUnmount() {
    EpsonEposSDK.emitter.remove();
  }

  onPressDiscover = () => {
    const discoveredPrinters = [];
    this.setState({ discoveredPrinters });
    EpsonEposSDK.discoverPrinters();
  };

  onConnect = async listItem => {
    try {
      var result = await EpsonEposSDK.connect(
        this.state.printerTarget,
        this.state.printerType,
        EpsonEposSDK.EPOS2_MODEL_ANK,
        3000
      );
    } catch (e) {
      Alert.alert("Alert", " " + e, { cancelable: false });
    }
  };

  onPressSimplePrint = () => {
    EpsonEposSDK.printSimpleText("1234567890123456789012345678901234567890");
  };

  onPressPrint = () => {
    EpsonEposSDK.printText(
      "Example Text\n",
      EpsonEposSDK.EPOS2_FONT_B,
      EpsonEposSDK.EPOS2_ALIGN_CENTER,
      2,
      4
    );
  };

  onPressPrintImage = async () => {
    try {
      var result = await EpsonEposSDK.printImage(
        "https://picsum.photos/500/400/?random",
        EpsonEposSDK.EPOS2_MODE_MONO,
        EpsonEposSDK.EPOS2_HALFTONE_ERROR_DIFFUSION
      );
    } catch (e) {
      Alert.alert("Alert", " " + e, { cancelable: false });
    }
  };

  onPressPrintBase64Image = async () => {
    try {
      var result = await EpsonEposSDK.printBase64Image(
        "",
        EpsonEposSDK.EPOS2_MODE_MONO,
        EpsonEposSDK.EPOS2_HALFTONE_ERROR_DIFFUSION
      );
    } catch (e) {
      Alert.alert("Alert", " " + e, { cancelable: false });
    }
  };

  onPressCutPaper = () => {
    EpsonEposSDK.cutPaper();
  };

  onPressOpenCashDrawer = () => {
    EpsonEposSDK.openCashDrawer();
  };

  onPressGetStatus = async () => {
    try {
      var result = await EpsonEposSDK.getStatus();
      Alert.alert("Response", " " + result, { cancelable: false });
    } catch (e) {
      Alert.alert("Alert", " " + e, { cancelable: false });
    }
  };

  onPressDisconnect = () => {
    EpsonEposSDK.disconnect();
    this.setState(() => ({ printerStatus: "Disconnected" }));
  };

  connectPrinter = async listItem => {
    try {
      var result = await EpsonEposSDK.connect(
        listItem.key,
        listItem.type,
        EpsonEposSDK.EPOS2_MODEL_ANK,
        3000
      );
    } catch (e) {
      Alert.alert("Alert", " " + e, { cancelable: false });
    }
  };

  renderItem = ({ item }) => {
    return (
      // <TouchableOpacity onPress={() => this.connectPrinter(item)}>
      //   <Text style={styles.printername}>{item.name}</Text>
      //   <Text style={styles.ipaddress}>{item.ip}</Text>
      //   <View style={{ width: "100%", height: 1, backgroundColor: "gray" }} />
      // </TouchableOpacity>
      <TouchableOpacity onPress={() => this.setState(() => ({ printerTarget: item.key, printerType: item.type}))}>
        <Text style={styles.printername}>{item.name}</Text>
        <Text style={styles.ipaddress}>{item.ip}</Text>
        <View style={{ width: "100%", height: 1, backgroundColor: "gray" }} />
      </TouchableOpacity>
  );
  };

  render() {
    return (
      <View>
        <Text></Text>
        <Text></Text>
        <Button
          onPress={this.onPressDiscover}
          title="Discover"
          color="#1515BF"
        />
        <Text>Discovered Printers (tap to connect):</Text>
        <FlatList
          height={130}
          backgroundColor="#E0E0E0"
          data={this.state.discoveredPrinters}
          renderItem={this.renderItem}
        />
        <Text></Text>
        <Button onPress={this.onConnect} title="Connect" color="#1515BF" />
        <Text></Text>
        <Button onPress={this.onPressSimplePrint} title="Simple Print" color="#1515BF" />
        <Text></Text>
        <Button onPress={this.onPressPrint} title="Print" color="#1515BF" />
        <Text></Text>
        <Button onPress={this.onPressPrintImage} title="Print Image" color="#1515BF" />
        <Text></Text>
        <Button onPress={this.onPressPrintBase64Image} title="Print Base64 Image" color="#1515BF" />
        <Text></Text>
        <Button onPress={this.onPressCutPaper} title="Cut Paper" color="#1515BF" />
        <Text></Text>
        <Button onPress={this.onPressOpenCashDrawer} title="Open Cash Drawer" color="#1515BF" />
        <Text></Text>
        <Button onPress={this.onPressGetStatus} title="Get Printer Status" color="#1515BF" />
        <Text></Text>
        <Button onPress={this.onPressDisconnect} title="Disconnect" color="#1515BF" />
        <Text></Text>
        <Text>Printer Status: {this.state.printerStatus}</Text>
        <Text>Target: {this.state.printerTarget}</Text>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 50,
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#F5FCFF"
  },
  h2text: {
    marginTop: 10,
    fontFamily: "Helvetica",
    fontSize: 36,
    fontWeight: "bold"
  },
  flatview: {
    justifyContent: "center",
    paddingTop: 10,
    borderRadius: 2
  },
  printername: {
    height: 18,
    fontFamily: "Verdana",
    fontSize: 14
  },
  ipaddress: {
    fontSize: 10,
    color: "blue"
  }
});
